function levenshteinDistance(str1, str2) {
  console.log(str1, str2);
  const m = str1.length;
  const n = str2.length;

  if (m === 0) return n;
  if (n === 0) return m;

  const dp = Array.from(Array(m + 1), () => Array(n + 1).fill(0));

  for (let i = 0; i <= m; i++) {
    dp[i][0] = i;
  }

  for (let j = 0; j <= n; j++) {
    dp[0][j] = j;
  }

  for (let i = 1; i <= m; i++) {
    for (let j = 1; j <= n; j++) {
      const cost = str1[i - 1] === str2[j - 1] ? 0 : 1;
      dp[i][j] = Math.min(
        dp[i - 1][j] + 1,
        dp[i][j - 1] + 1,
        dp[i - 1][j - 1] + cost
      );
    }
  }

  const maxLen = Math.max(m, n);
  const distance = dp[m][n];
  const matchPercentage = (maxLen - distance) / maxLen * 100;

  return matchPercentage;
}

let absent = 0,
  present = 0,
  total = 0;
const listOfAbsent = [];

const batchSize = 100;

const processBatch = batch => {
  batch.forEach(company => {
    total = total + 1;
    const exists = db.masterCompanies
      .aggregate([
        {
          $search: {
            index: "masterCompanies",
            text: {
              query: company.name,
              path: "companies.name"
            }
          }
        },
        {
          $project: {
            _id: 1,
            name: 1,
            score: { $meta: "searchScore" }
          }
        }
      ])
      .toArray();
    const masterCompany = exists.find(e => typeof e.name !== "undefined") || {};
    const match =
      typeof masterCompany.name !== "undefined"
        ? levenshteinDistance(masterCompany.name, company.name)
        : 0;
    // if(match > 95) {
    // 	present = present + 1;
    // }
    // else{
    listOfAbsent.push({
      name: company.name,
      match,
      masterName: masterCompany.name || "",
      masterId: masterCompany._id || "",
      hdfcId: company.hdfcCode
    });
    absent = absent + 1;
    // }
  });
  print(absent, present, total, listOfAbsent);
};

